<!doctype html>
<html lang="en">
<head>
    <meta charset="UTF-8">
    <meta name="viewport"
          content="width=device-width, user-scalable=no, initial-scale=1.0, maximum-scale=1.0, minimum-scale=1.0">
    <meta http-equiv="X-UA-Compatible" content="ie=edge">
    <style>
        @page {
            margin: 0;
        }

        body {
            font-family: DejaVu Sans, sans-serif;
            font-size: 18px;
        }

        .container {
            position: relative;
        }

        .logo_container {
            position: absolute;
            top: 2.5%;
            left: 5%;
            width: 75px;
            height: 75px;
            border-radius: 50%;
            z-index: 2;
            background-color: #0066FF;
            padding: 15px;
        }

        .logo_container img {
            display: inline-block;
            width: 90%;
            height: auto;
            position: absolute;
            top: 50%;
            left: 50%;
            transform: translate(-50%, -50%);
            z-index: 0;
            border-radius: 50%;
        }

        .bg_image {
            position: absolute;
            top: 0;
            left: 0;
            right: 0;
            bottom: 0;
            width: 100%;
            height: 100%;
            z-index: 1;
        }

        .information {
            display: block;
            z-index: 2;
            color: #e5e7eb;
        }

        .information h1 {
            font-weight: 700;
            font-size: 2.5rem;
            text-align: center
        }

        .title {
            text-align: center;
            margin-top: 15%;
        }

        .subtitle {
            margin-top: -2.5%;
            font-size: 1rem;
            text-transform: uppercase;
            text-align: center;
        }

        .table {
            position: absolute;
            transform: translate(-50%, -50%);
            top: 50%;
            left: 50%;
            width: 100%;
            padding-left: 5%;
            padding-right: 15%
        }

        .date {
            position: absolute;
            top: 25%;
            left: 5%;
            font-size: 12px;
        }

        .place {
            position: absolute;
            top: 25%;
            right: 5.5%;
            font-size: 12px;
        }

        .cell_right {
            display: inline-block;
            width: 50%;
            padding: 16px;
            border: 1px solid #0066FF;
        }

        .cell_left {
            display: inline-block;
            width: 30%;
            padding: 16px;
            border: 1px solid #0066FF;
            background-color: #0066FF;
        }
        .copyright {
            position: absolute;
            left: 5%;
            bottom: 2.5%;
            color: #e5e7eb;
            font-size: 10px;
            z-index: 2;
        }
    </style>
    <title>Заказ № {{ $orderId }}</title>
</head>
<body>
<div class="container">
    <div class="logo_container">
        <img
            src="data:image/png;base64,"
            alt="Logo" class="logo_image">
    </div>
    <img class="bg_image"
         src="data:image/svg+xml;base64,"
         alt="Background">
    <div class="information">
        <h1 class="title">Заказ № {{ $orderId }}</h1>
        <h2 class="subtitle">информация о заказе</h2>
        <div class="date">
            <span>Дата: {{ now()->format('d.m.Y') }}</span>
        </div>
        <div class="place">
            <span>Адрес: {{ $address }}</span>
        </div>
        <div class="table">
            <div style="width: 100%; margin-bottom: 1%">
                <div class="cell_left">
                    <span style="font-weight: 700">Услуга</span>
                </div>
                <div class="cell_right">
                    <span>{{ $service }}</span>
                </div>
            </div>
            <div style="width: 100%; margin-bottom: 1%">
                <div class="cell_left">
                    <span style="font-weight: 700">Наименование</span>
                </div>
                <div class="cell_right">
                    <span>{{ $name }}</span>
                </div>
            </div>
            <div style="width: 100%; margin-bottom: 1%">
                <div class="cell_left">
                    <span style="font-weight: 700">Исполнитель</span>
                </div>
                <div class="cell_right">
                    <span>{{ $employee }}</span>
                </div>
            </div>
            <div style="width: 100%; margin-bottom: 1%">
                <div class="cell_left">
                    <span style="font-weight: 700">Установлено единиц:</span>
                </div>
                <div class="cell_right">
                    <span>{{ $count }} шт.</span>
                </div>
            </div>
            <div style="width: 100%; margin-bottom: 1%">
                <div class="cell_left">
                    <span style="font-weight: 700"> Цена (с НДС 20%)</span>
                </div>
                <div class="cell_right">
                    <span>{{ $price }} BYN</span>
                </div>
            </div>
        </div>
    </div>
    <div class="copyright">
        <span>ИП Полонец Олег Иванович. Все права защищены</span>
    </div>
</div>
</body>
</html>
